import React from "react";
import { Link } from "react-router-dom";

export default function Footer() {
  return (
    <nav className="footer">
      <Link to="/" className="footer-links">
        home
      </Link>
      <Link to="/" className="footer-links">
        shop
      </Link>
      <Link to="/" className="footer-links">
        news
      </Link>
      <Link to="/" className="footer-links">
        contact
      </Link>
      <Link to="/" className="footer-links">
        mailinglist
      </Link>
    </nav>
  );
}
